  async createImage(imagePath: string, width: number, height: number): Promise<Paragraph[]> {
    // Fetch the image and convert Blob to ArrayBuffer
    const response = await fetch(imagePath);
    const blob = await response.blob();
    const arrayBuffer = await blob.arrayBuffer(); // Convert Blob to ArrayBuffer
    const uint8Array = new Uint8Array(arrayBuffer); // Convert ArrayBuffer to Uint8Array

    return [
      new Paragraph({
        alignment: AlignmentType.CENTER,
        children: [
          new ImageRun({
            data: uint8Array.buffer as ArrayBuffer,
            transformation: {
              width,
              height
            },
            type: "png",
          }),

        ],
      }),
    ];
  }

